draw((2,.25)--(2,-.25),linewidth(1));
draw((3,.25)--(3,-.25),linewidth(1));
draw((4,.25)--(4,-.25),linewidth(1));
draw((5,.25)--(5,-.25),linewidth(1));
draw((6,.25)--(6,-.25),linewidth(1));

