label("$(6,3)$",(6,3),N);
[/asy]

Please solve the following problem and only output the answer at the end with "The answer is: ".Calculate the sum $f(2,1) + f(2,4) + f(3,-1)$ where $f(a,b)$ is defined as
\[f(a,b) = \left\{
