Please solve the following problem and only output the answer at the end with "The answer is: ".A white cylindrical silo has a diameter of 30 feet and a height of 80 feet.  A red stripe with a horizontal  width of 3 feet is painted on the silo, as shown, making two complete revolutions around it. What is the area of the stripe in square feet?

[asy]
